import {Link} from 'react-router-dom';
//import logo from '../logo.png';


function Navbar() {
    return(
    <nav className="navbar">
        <div className="navbar-container">

            <Link to='/' className="navbar-logo">
                TLP 
            </Link>
        </div>
    </nav>
    )
}

export default Navbar
